import React, { useEffect, useState } from "react";
import { Card, Col, Form, Layout, Row } from "antd";
import { BackHeader, FormButton } from "../../utils/components";
import "./CheckoutPayment.less";
import { useHistory, useLocation } from "react-router-dom";

import { RoutePath } from "../../utils/routePath";
import Title from "antd/lib/typography/Title";

interface CheckoutPaymentProps {}

export const CheckoutPayment: React.FC<CheckoutPaymentProps> = ({}) => {
    const location = useLocation();

    const history = useHistory();

    const [checkOutStatus, setCheckoutStatus] = useState<any>();

    const onFinish = async () => {
        setLoading(true);

        history.replace(RoutePath.home);

        setLoading(false);
    };

    // Is loading flag
    const [isLoading, setLoading] = useState(false);

    useEffect(() => {
        // Get the parameter value from url
        const data: any = new URLSearchParams(location.search).get("status");
        setCheckoutStatus(data);
    }, []);

    return (
        <Layout className="layout" style={{ overflow: "auto" }}>
            <div className="navbar" style={{ backgroundColor: "#fff" }}>
                <BackHeader title="Checkout" />
            </div>
            <Layout className="checkout_content" style={{ backgroundColor: "white" }}>
                <Row className="checkout_row">
                    <Col xs={24} xl={8} className="checkout_col" span={8} />
                    <Col xs={24} xl={8} className="checkout_col" span={8}>
                        <Card>
                            <Form
                                name="check_out_form"
                                className="check_out_form"
                                initialValues={{ remember: true }}
                                onFinish={onFinish}
                            >
                                <Title level={5}>
                                    {" "}
                                    Your payment is {checkOutStatus}
                                </Title>

                                <Form.Item>
                                    <FormButton
                                        title="Back to home"
                                        isLoading={isLoading}
                                    />
                                </Form.Item>
                            </Form>
                        </Card>
                    </Col>
                    <Col xs={24} xl={8} className="checkout_col" span={8} />
                </Row>
            </Layout>
        </Layout>
    );
};
